const Navebar = () => {



    return (

        //    < !--Load an icon library to show a hamburger menu(bars) on small screens-- >
        <>
            <div className="topnav" id="myTopnav">
                <a href="#home" className="active">DENTIST.COM</a>
                <a href="#news">Iphone</a>
                <a href="#contact">Samsung</a>
                <a href="#about">Honer</a>



            </div>
        </>
    );


}
export default Navebar;
